 Project </h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Applying Excel, Power BI, and Tableau to a real-world business problem.</p>', NULL),
(37, '2024-02-09 04:13:49', '2024-02-09 04:13:49', 'Artificial Intelligence & Machine Learning', 'assets/media/thumbnail/65c5f3d5c45f2_Ai-ml.png', 23, '<p><br></p><p><br></p><h1>1 Introduction to AI</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;What is AI?</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;History and Evolution of AI</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Applications of AI in Various Domains</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Ethical and Societal Considerations</p><p><br></p><h1>2 Problem Solving and Search Algorithms</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;State Space Search</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Uninformed Search Algorithms (e.g., BFS, DFS)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Informed Search Algorithms (e.g., A*)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Heuristic Functions</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Local Search (e.g., Hill Climbing, Simulated Annealing)</p><p><br></p><h1>3 Machine Learning Basics</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Introduction to machine learning and its types</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Supervised, unsupervised, and reinforcement learning</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Data preprocessing and feature engineering</p><p><br></p><h1>4 Supervised Learning Algorithms</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Linear regression</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Logistic regression</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Decision trees</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Random forests</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Support vector machines (SVM)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Evaluation metrics for classification and regression</p><p><br></p><h1>5 Unsupervised Learning Algorithms</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Clustering algorithms: K-means, hierarchical clustering, DBSCAN</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dimensionality reduction: PCA, LDA</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Association rule mining</p><p><br></p><h1>6 Neural Networks and Deep Learning</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Introduction to artificial neural networks (ANNs)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Feedforward neural networks</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Convolutional neural networks (CNNs)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Recurrent neural networks (RNNs)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Training techniques: Backpropagation, optimization algorithms</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Deep learning frameworks: TensorFlow, PyTorch</p><p><br></p><h1>7 Natural Language Processing (NLP)</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Text preprocessing and tokenization</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Word embeddings: Word2Vec, GloVe</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;NLP tasks: Sentiment analysis, named entity recognition, language translation</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Sequence-to-sequence models</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Attention mechanisms</p><p><br></p><h1>8 Computer Vision</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Image preprocessing</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Convolutional neural networks for image classification and object detection</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Transfer learning in computer vision</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Applications of computer vision: Face recognition, image generation</p><p><br></p><h1>9 Reinforcement Learning</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Basics of reinforcement learning</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Markov decision processes (MDPs)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Q-learning and Deep Q Networks (DQNs)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Policy-based methods and actor-critic methods</p><p><br></p><h1>10 Advanced AI Topics</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Generative Adversarial Networks (GANs)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Transfer learning and domain adaptation</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Explainable AI</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;AI in robotics and autonomous systems</p><p><br></p><h1>11: Ethical and Social Implications of AI</h1><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bias and fairness in AI</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;AI and privacy</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;AI and jobs: Automation and societal impact</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Responsible AI development and deployment</p>', NULL);

